import RingFooter from "../components/ring/RingFooter";
import RingFaq from "../components/ring/RingFaq";
import RingNext from "../components/ring/RingNext";
import RingHeader from "../components/ring/RingHeader";


const Ring = () => {
    return (
        <>
            <RingHeader></RingHeader>
            {/* <HomeHero></HomeHero> */}
            {/* <HomeVision></HomeVision> */}
            {/* <HomeWork></HomeWork> */}
            <RingMsg></RingMsg>
            <RingNext></RingNext>
            <RingFaq></RingFaq>
            <RingFooter></RingFooter>
        </>
    );
}

export default Ring;
